      out.write("   ** setTimeout()\n");
      out.write("   **/\n");
      out.write("  function drawMouseSpeedDemo() {\n");
      out.write("    var mrefreshinterval = 500; // update display every 500ms\n");
      out.write("    var lastmousex = -1;\n");
      out.write("    var lastmousey = -1;\n");
      out.write("    var lastmousetime;\n");
      out.write("    var mousetravel = 0;\n");
      out.write("    var mpoints = [];\n");
      out.write("    var mpoints_max = 30;\n");
      out.write("    $('html').mousemove(function (e) {\n");
