      out.write("      var mousey = e.pageY;\n");
      out.write("      if (lastmousex > -1) {\n");
      out.write("        mousetravel += Math.max(Math.abs(mousex - lastmousex), Math.abs(mousey - lastmousey));\n");
      out.write("      }\n");
      out.write("      lastmousex = mousex;\n");
      out.write("      lastmousey = mousey;\n");
      out.write("    });\n");
      out.write("    var mdraw = function () {\n");
      out.write("      var md = new Date();\n");
      out.write("      var timenow = md.getTime();\n");
      out.write("      if (lastmousetime && lastmousetime != timenow) {\n");
      out.write("        var pps = Math.round(mousetravel / (timenow - lastmousetime) * 1000);\n");
      out.write("        mpoints.push(pps);\n");
      out.write("        if (mpoints.length > mpoints_max)\n");
      out.write("          mpoints.splice(0, 1);\n");
      out.write("        mousetravel = 0;\n");
