      out.write("      setTimeout(mdraw, mrefreshinterval);\n");
      out.write("    };\n");
      out.write("    // We could use setInterval instead, but I prefer to do it this way\n");
      out.write("    setTimeout(mdraw, mrefreshinterval);\n");
